export function getMarinadeFinanceErrorMessage(
  code: MarinadeFinanceError
): string {
  if (process.env.NODE_ENV !== 'production') {
    return (
      marinadeFinanceErrorMessages as Record<MarinadeFinanceError, string>
    )[code];
  }

  return 'Error message not available in production bundles.';
}

export function isMarinadeFinanceError<
  TProgramErrorCode extends MarinadeFinanceError,
>(
  error: unknown,
  transactionMessage: {
    instructions: Record<number, { programAddress: Address }>;
  },
  code?: TProgramErrorCode
): error is SolanaError<typeof SOLANA_ERROR__INSTRUCTION_ERROR__CUSTOM> &
  Readonly<{ context: Readonly<{ code: TProgramErrorCode }> }> {
  return isProgramError<TProgramErrorCode>(
    error,
    transactionMessage,
    MARINADE_FINANCE_PROGRAM_ADDRESS,
    code
  );
}
